import { Route } from "react-router-dom";
import About from "./Pages/About/about";
import Blog from "./Pages/Blog/blog";
import Gallery from "./Pages/Gallery/Gallery";
import Home from "./Pages/Home/Home";



function App() {
  return (
    <div>
      <Route path="/">
        <Home/>
      </Route>
      <Route path="/gallery">
        <Gallery />
      </Route>
      <Route path="/blog">
        <Blog />
      </Route>
      <Route path="/about">
        <About />
      </Route>
    </div>
  );
}

export default App;
